import React from 'react';
import './App.css';

class App extends React.Component {
  render() {
    const album01 = {
      title: 'The Dark Side of the Moon',
      artist: 'Pink Floyd',
      releaseYear: 1973,
      imagem:"https://upload.wikimedia.org/wikipedia/en/3/3b/Dark_Side_of_the_Moon.png",
      releaseDate: {
        day: 23,
        month: 'February',
        year: 1985
      },
      others: {
        recordCompany: ""
      }
    }
    return (
      <div className="App">
        <h1>Hello, World!{album01.releaseDate.day}</h1>
      </div>
    );
  }
}

export default App;
